const baseButtonStyle = {
    padding: '14px 27px',
    outline: 'none',
    cursor: 'pointer',
    borderRadius: '30px',
    fontSize: '17px',
};

const blueButtionStlye = {
  ...baseButtonStyle,
  backgroundColor: 'rgba(0, 89, 255, 0.2)',
  border: 'solid 1px #7090ff',
  color: '#7090ff',
}

const redButtionStlye = {
  ...baseButtonStyle,
  backgroundColor: 'rgba(255, 78, 78, 0.2)',
  border: 'solid 1px #ff4664',
  color: '#ff4664',
}

function Button({ children, onClick, color }) {
  const style = color === 'red'? redButtionStlye: blueButtionStlye;
  return (
  <button style={style} onClick={onClick}>
    {children}
  </button>
  )
}

export default Button;
